import React from "react";

function FloatingDiv({image}) {
  return (
    <>
          <div className="floatingdiv">
              <img src="" alt=""/>
              <span>
                  Web
                  <br />
                  Developer
              </span>
      </div>
    </>
  );
}

export default FloatingDiv;
